import React, { useState } from 'react';

const TreeNode = ({ node }) => {
  const [isOpen, setIsOpen] = useState(false);

  const handleToggle = () => {
    setIsOpen(!isOpen);
  }

  return (
    <ul style={{ listStyleType: 'none', userSelect: 'none' }}>
      <li>
        <button onClick={handleToggle} disabled={!node.children}>
          {isOpen ? '-' : '+'}
        </button>
        {node.name}
        {isOpen && node.children && (
          <ul>
            {node.children.map(childNode => (
              <TreeNode key={childNode.id} node={childNode} />
            ))}
          </ul>
        )}
      </li>
    </ul>
  );
};

const Tree = ({ data }) => (
  <div>
    {data.map(node => (
      <TreeNode key={node.id} node={node} />
    ))}
  </div>
);

const Webgl = () => {
  const treeData = [
    {
      id: 1,
      name: 'Dyrektor operacyjny',
      children: [
        {
          id: 2,
          name: 'Kierownik produkcji',
        },
        {
          id: 3,
          name: 'Kierownik jakości',
          children: [
            {
              id: 4,
              name: 'Parobek 1',
            },
          ],
        },
      ],
    },
    {
      id: 5,
      name: 'Dyrektor finansowy',
    },
  ];

  return <Tree data={treeData} />;
};

export default Webgl;
